import './App.css';
import './index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Loader from '../src/Components/Component-Loader/Loader';
import About_page from './Pages/About-Pages/About-Page';
import Music_page from './Pages/Music-Pages/Music-Page';
import Game_page from './Pages/Game-Pages/Game-Page';
import TLR_page from './Pages/Game-Pages/The_Last_Rest_Page';
import UnderHome_page from './Pages/Game-Pages/UnderHome_Page';
import Comics_page from './Pages/Comics-Pages/Comics-Page';
import TheLetterOfDeath_page from './Pages/Comics-Pages/TLOD-Page';
// import ThroughTheGasToTheDoorstep_page from './Pages/Comics-Page';
import Book_page from './Pages/Book-Pages/Book-Page';

export default function App() {
  return (
    <Router>
      <div>
        {/* Додаємо компонент Loader для прогрузки сторінки */}
        <Loader />

        {/* Перемикання сторінок */}
        <Routes>
          <Route path="/" element={<About_page />} />
          <Route path="/music" element={<Music_page />} />
          <Route path="/game" element={<Game_page />} />
          <Route path="/game/the-last-rest" element={<TheLastRest_page />} />
          <Route path="/game/under-home" element={<UnderHome_page />} />
          <Route path="/comics" element={<Comics_page />} />
          <Route path="/comics/the-letter-of-death" element={<TheLetterOfDeath_page />} />
          {/* <Route path="/comics/through-the-gas-to-the-doorstep" element={<Comics_page />} /> */}
          <Route path="/book" element={<Book_page />} />
        </Routes>
      </div>
    </Router>
  );
}
